#version 330


// Attributes

#define POSITION            0
#define COLOR               1
#define NORMAL              2
#define TEXCOORD            3
#define DRAW_ID             4

// Outputs
#define FRAG_COLOR 0

layout(std140, column_major) uniform;


// Incoming vertex position, Model Space
layout (location = POSITION) in vec2 position;

// Incoming vertex color
layout (location = COLOR) in vec3 color;


uniform GlobalMatrices
{
    mat4 view;
    mat4 proj;
};


// Uniform matrix from Model Space to camera (also known as view) Space
uniform mat4 model;


// Outgoing color for the next shader (fragment in this case)
out vec3 interpolatedColor;


void main() {

    // Normally gl_Position is in Clip Space and we calculate it by multiplying together all the matrices
    gl_Position = proj * (view * (model * vec4(position, 0, 1)));

    // We assign the color to the outgoing variable.
    interpolatedColor = color;
}

#version 330


// Attributes

#define POSITION            0
#define COLOR               1
#define NORMAL              2
#define TEXCOORD            3
#define DRAW_ID             4

// Outputs
#define FRAG_COLOR 0

layout(std140, column_major) uniform;


// Incoming interpolated (between vertices) color from the vertex shader.
in vec3 interpolatedColor;


// Outgoing final color.
layout (location = FRAG_COLOR) out vec4 outputColor;


void main()
{
    // We simply pad the interpolatedColor to vec4
    outputColor = vec4(interpolatedColor, 1);
}
